import "./App.css";
import Header from "./components/header";
import Login from "./pages/Login";
import Main from "./components/main";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams,
} from "react-router-dom";

function App() {
  const list = [
    { title: "Descargar", link: "discor.com", key: 1 },
    {
      title: "¿Por qué Discord?",

      link: "/",
      key: 2,
    },
    { title: "Nitro", link: "https://discord.com/nitro", key: 3 },
    { title: "Seguridad", link: "https://discord.com/safety", key: 4 },
    {
      title: "Soporte técnico",
      link: "https://support.discord.com/hc/es",
      key: 5,
    },
  ];
  return (
    <Router>
      <div className="App"></div>
      <div>
        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route exact path="/login" component={Login} />
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );

  function Home() {
    return (
      <div>
        <Header titleListElement={list}></Header>
        <Main></Main>
      </div>
    );
  }

  function Login() {
    let match = useRouteMatch();
    return <Link to={`${match.url}/pages/Login`}>Components</Link>;
  }
}

export default App;
